// src/components/Resume.js
import React from "react";

export default function Resume() {
  return (
    <section id="resume" className="my-12 px-4 max-w-4xl mx-auto">
      <h2 className="text-3xl font-bold mb-6 text-center">My Resume</h2>

      <div className="border rounded-md overflow-hidden shadow-lg mb-4">
        <iframe
          src="/Pavithra S E Resume.pdf"
          title="Resume"
          className="w-full"
          style={{ height: "500px", border: "none" }}
        ></iframe>
      </div>

      <div className="text-center">
        <a
          href="/Pavithra S E Resume.pdf"
          download
          className="inline-block bg-blue-600 text-white px-6 py-3 rounded hover:bg-blue-700 transition"
        >
          Download Resume
        </a>
      </div>
    </section>
  );
}
